    s = init(key)
    assert not _is_legal_drop(s.piece_board, s.hand.at[:].set(1), PAWN, xy2i(5, 7))

    # æã£ã¦ãªã
    s = init(key)
    assert not _is_legal_drop(s.piece_board, s.hand, PAWN, xy2i(5, 5))

    # åé§
    key = jax.random.PRNGKey(0)
